def is_palindrome(string):
    string = string.lower().replace(" ", "")
    return string == string[::-1]

text = "A man a plan a canal Panama"
if is_palindrome(text):
    print(f'"{text}" is a palindrome.')
else:
    print(f'"{text}" is not a palindrome.')

